const times = preferences.time;
const uniqueSamples = getSamples(times);

const records = [];
for (const uniqueSample of uniqueSamples) {
    const sample = {
        ...uniqueSample,
        userInfo: userInfo.email,
        results: []
    };
    for (const time of times) {
        const hours = time.hours;
        for (const substance of time.subtance) {
            const extract = JSON.parse(substance.extract);
            if (extract.uuid === uniqueSample.uuid) {
                sample.results.push({
                    hours,
                    units: substance.unit,
                    concentration: substance.concentration,
                    measurements: substance.quartiles,
                })
            }
        }
    }
    records.push(sample);
}

const samples = [];
for (const record of records) {
    const entry = {
        user: record.userInfo,
        date: getDate(),
        results: record.results
    }

    const sample = await new Sample(couchDB, record.uuid, {
        track:true
    });
    await sample.sample.then(async () => {
        if (!sample.sample.$content.biology.depolarization) {
            sample.sample.$content.biology.depolarization = [];
        }
        sample.sample.$content.biology.depolarization.push(entry);
        await sample.handleAction({ name: 'save' });
        console.log(sample);

    })
    samples.push(sample)
}

function getDate(){
    const today = new Date();
    const dd = String(today.getDate()).padStart(2, '0');
    const mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
    const yyyy = today.getFullYear();
    return mm + '/' + dd + '/' + yyyy;
}

function getSamples(times) {
    const uuids = [];
    const samples = [];
    for (const time of times) {
        const hours = time.hours;
        for (const substance of time.subtance) {
            const extract = JSON.parse(substance.extract);
            uuids.push(extract.uuid)
            samples.push(extract);
        }
    }
    const uniqueUuids = [...new Set(uuids)];
    const uniqueSamples = [];
    for (const uuid of uniqueUuids) {
        for (const sample of samples) {
            if (sample.uuid === uuid) {
                uniqueSamples.push(sample);
                break
            } 
        }
    }
    return uniqueSamples;
}

