function meanDepolarization(measuresList){
    const array = [];
    for (const measure of measuresList) {
        const results = measure.results;
        let q14 = 0; let q23 = 0;;
        for (const result of results) {
            q14 += result.q1 + result.q4;
            q23 += result.q2 + result.q3;
        }
        let q14m = q14/results.length;
        let q23m = q23/results.length;

        let q14e = 0; let q23e = 0;
        for (const result of results) {
            let p1 = (result.q1 + result.q4 - q14m);
            let p2 = (result.q2 + result.q3 - q23m);
            q14e += p1 * p1;
            q23e += p2 * p2;
        }
        array.push({
            label: measure.hours +  " " + measure.label +  " " + measure.concentration.toString(),
            q14: {
                mean: q14m,
                std: Math.sqrt(q14e)
            },
            q23: {
                mean: q23m,
                std: Math.sqrt(q23e)
            }
        })
    }
    return array;
}

